import React from "react";
import "./Skills.css";
function Skills() {
  return (
    <section className="skills-container">
      <h5>Technical Proficiency</h5>
      <div className="skills-content">
        <div className="skills"></div>
        <div className="skills"></div>
      </div>
    </section>
  );
}

export default Skills;
